import React from 'react'
import { EventsData } from '../data/EventsData'

const Events = () => {
  return (
    <div>
      <header id="page-header">
        <div className="page-heading">
          <h2>Events</h2>
        </div>
      </header>

      <div className="page-container">

      </div>

      {EventsData.map(item=>{
        return(
          <div>
            {item.title}
          </div>
        )
      })}
    </div>
  )
}

export default Events
